define('text!app/template/contributors.html',[],function () { return '<div class="contributors">\r\n  <h2>Current contributors</h2>\r\n  <ul data-bind="foreach: contributors">\r\n    <li class="contributor">\r\n      <div class="name"><span data-bind="text: name"></span> (<span data-bind="text: contribution"></span>)</div>\r\n      <div class="email"><a data-bind="attr: { href: \'mailto:\' + email }, text: email"></a></div>\r\n      <div class="urls" data-bind="foreach: urls">\r\n        <div class="url"><a data-bind="attr: { href: url }, text: url" target="_blank"></a></div>\r\n      </div>\r\n    </li>\r\n  </ul>  \r\n</div>';});


